import ExpenseApp from "./expenseApp";
import Card from "../Card/card";
import "./expenseApp.css";

const ExpenseItem = (expenseData) => {
  return (
    <Card className="expenses">
      <ExpenseApp
        title={expenseData.expenseData[0].title}
        amount={expenseData.expenseData[0].amount}
        date={expenseData.expenseData[0].date}
      ></ExpenseApp>
      <ExpenseApp
        title={expenseData.expenseData[1].title}
        amount={expenseData.expenseData[1].amount}
        date={expenseData.expenseData[1].date}
      ></ExpenseApp>
      <ExpenseApp
        title={expenseData.expenseData[2].title}
        amount={expenseData.expenseData[2].amount}
        date={expenseData.expenseData[2].date}
      ></ExpenseApp>
      <ExpenseApp
        title={expenseData.expenseData[3].title}
        amount={expenseData.expenseData[3].amount}
        date={expenseData.expenseData[3].date}
      ></ExpenseApp>
    </Card>
  );
};
export default ExpenseItem;
